import{_ as e,o as a,c as n,Q as o}from"./chunks/framework.6e0d310a.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),t={name:"faq.md"},r=o('<h2 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h2><h4 id="do-i-need-to-buy-any-google-subscription-for-teamone" tabindex="-1">Do I need to buy any Google subscription for TeamOne? <a class="header-anchor" href="#do-i-need-to-buy-any-google-subscription-for-teamone" aria-label="Permalink to &quot;Do I need to buy any Google subscription for TeamOne?&quot;">​</a></h4><p>No. Even a free gmail account would work for individual licenses. Though if you purchase a Google Workspace plan, you will be able to install and configure TeamOne for all your users.</p><h4 id="does-any-server-side-software-need-to-be-installed" tabindex="-1">Does any server side software need to be installed? <a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-label="Permalink to &quot;Does any server side software need to be installed?&quot;">​</a></h4><p>No. TeamOne lives in Google Cloud and does not require anything to be installed on IBM PA (TM1) server or you computer.</p><h4 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" tabindex="-1">Will any of my data be sent or stored on any 3rd party servers? <a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-label="Permalink to &quot;Will any of my data be sent or stored on any 3rd party servers?&quot;">​</a></h4><p>TeamOne connects directly from your browser to IBM Planning Analytics / TM1 server. No data is being sent or stored on any other servers.</p><h4 id="can-teamone-connect-to-ibm-planning-analytics-cloud" tabindex="-1">Can TeamOne connect to IBM Planning Analytics Cloud <a class="header-anchor" href="#can-teamone-connect-to-ibm-planning-analytics-cloud" aria-label="Permalink to &quot;Can TeamOne connect to IBM Planning Analytics Cloud&quot;">​</a></h4><p>Yes, TeamOne can connect to PA cloud. You can configure a Single-Sign-On or use a non-interactive user account.</p><h4 id="what-ibm-planning-analytics-version-is-supported" tabindex="-1">What IBM Planning Analytics version is supported <a class="header-anchor" href="#what-ibm-planning-analytics-version-is-supported" aria-label="Permalink to &quot;What IBM Planning Analytics version is supported&quot;">​</a></h4><p>Even though some functionality may work in the older versions, TeamOne add-on officially supports IBM Planning Analytics version 2.0.5 or newer.</p><h4 id="which-tm1-integratedsecuritymode-does-teamone-support" tabindex="-1">Which TM1 IntegratedSecurityMode does TeamOne support? <a class="header-anchor" href="#which-tm1-integratedsecuritymode-does-teamone-support" aria-label="Permalink to &quot;Which TM1 IntegratedSecurityMode does TeamOne support?&quot;">​</a></h4><p>TeamOne supports the next TM1 integrated security modes: 1, 4, 5. If you don&#39;t specify <strong>-namespace</strong> property of your environment definition, it will use mode 1 for connecting to TM1.</p>',13),s=[r];function i(l,d,c,u,p,h){return a(),n("div",null,s)}const f=e(t,[["render",i]]);export{m as __pageData,f as default};
